    port: -1
qp:
  mill:
    backend:
      security:
        enabled: false
      calcite:
        connection:
          quoting: BACK_TICK
          caseSensitive: true
          unquotedCasing: UNCHANGED
          model: ./etc/config/test/model.yaml
